import React from "react";

import * as Styled from "./style";
import Tr from "../Tr";
import Th from "../Th";

import { CalculateBox } from "../../../utils";

const Table = ({ pad = [0], headData, bodyData }) => {
  let renderTableHeadData = () =>
    headData.map((data) => <Th width={data.width}>{data.name}</Th>);
  const padding = CalculateBox(pad);

  return (
    <Styled.Table padding={padding}>
      <thead>
        <Tr height="20px">{renderTableHeadData()}</Tr>
      </thead>
      <tbody></tbody>
    </Styled.Table>
  );
};

export default Table;
